import styled from 'styled-components';


export const Container = styled.div`
  height: 80px;
  background: #f5f5f5;
  padding: 15px 50px;
  a{
    padding: 15px 70px;
    float: right;
  }
  button{
    padding: 10px 10px;
    background: none;
    color: #1c6134;
    border: 1px solid #1c6134;
    border-radius: 3px;
  }
`;
